import React from 'react';
import NavBar from '../Locks/Pro/NavBar';
import Banner from '../Locks/Pro/Banner';
import Language from '../Locks/Pro/Language';
import Footer from '../Locks/Pro/Footer';

function HomeComponent() {
  return (
    <>
    <NavBar />
    <Banner />
    <Language/>
    <Footer />
    </>
  )
}

export default HomeComponent
